import kfp
from kfp.v2 import dsl
from kfp.v2.dsl import *
from typing import *

def parse_data_source(
    data_source_csv_filenames: Optional[str] = None,
    data_source_bigquery_table_path: Optional[str] = None,
) -> NamedTuple('Outputs', [
    ('data_source_bigquery_table_path', str),
    ('data_source_csv_filenames', List[str]),
]):
  """Converts the data source JSON into flat arguments."""
  # pylint: disable=g-import-not-at-top,import-outside-toplevel
  import collections
  import re
  # pylint: enable=g-import-not-at-top,import-outside-toplevel

  result = {
      'data_source_csv_filenames': data_source_csv_filenames,
      'data_source_bigquery_table_path': data_source_bigquery_table_path,
  }
  for k, v in list(result.items()):
    is_optional = any([
        v is None,
        isinstance(v, str) and v in {'', '-'},
    ])
    if is_optional:
      result.pop(k)
  if 'data_source_bigquery_table_path' in result:
    result['data_source_bigquery_table_path'] = re.sub(
        '^bq://', '', result['data_source_bigquery_table_path'])
  if 'data_source_csv_filenames' in result:
    result['data_source_csv_filenames'] = [
        filename.strip() for filename in data_source_csv_filenames.split(',')]
  return collections.namedtuple('Outputs', [
      'data_source_bigquery_table_path',
      'data_source_csv_filenames',
  ])(
      result.get('data_source_bigquery_table_path', ''),
      result.get('data_source_csv_filenames', []),
  )
